import React from 'react';
import styles from '../css/BarChart.css';

const data = [
    { label: 'HTML', percentage: 10 },
    { label: 'CSS', percentage: 20 },
    { label: 'ReactJS', percentage: 30 },
    { label: 'Github', percentage: 40 },
  ];
  
  const BarChart = () => {
    return (
      <div className={styles['bar-chart']}>
        {data.map(item => (
          <div key={item.label} className={styles['bar-container']}>
            <div className={styles['bar']} style={{ width: `${item.percentage}%` }}>
              <span className={styles['bar-label']}>{item.label}</span>
            </div>
            <div className={styles['bar-percentage']}>{item.percentage}%</div>
          </div>
        ))}
      </div>
    );
  };
  
  export default BarChart;
